var education_table = $("#education_table").DataTable({
	searching:false,
	paging:false,
	info:false,
	"bSort" : false
	});
var project_table = $("#project_table").DataTable({
	searching:false,
	paging:false,
	info:false,
	});
var training_table = $("#training_table").DataTable({
	searching:false,
	paging:false,
	info:false,
	});
var worksample_table = $("#worksample_table").DataTable({
	searching:false,
	paging:false,
	info:false,
	});
var internship_table = $("#internship_table").DataTable({
	searching:false,
	paging:false,
	info:false,
	});
var job_table = $("#job_table").DataTable({
	searching:false,
	paging:false,
	info:false,
	});
//get student details
function dispStudentData(st_id) {
	var blank_pro_image = "";
	$("#divLoading").show();
	$.ajax({
		type : "GET",
		url : "getStudentData?student_id=" + st_id,
		async:false,
		success : function(response) {

			$('#scrollDiv').scrollTop(0);
			// setting personal details
			var studentDetails = response.student;
			$("#name").text(studentDetails.student_name);
			$("#email").text(studentDetails.email_id);
			$("#contact").text(studentDetails.contact);
			if(studentDetails.photo!=null && studentDetails.photo != ""){
				document.getElementById("studentPic").src = "data:image/png;base64,"
					+ studentDetails.photo;
			}else{
				document.getElementById("studentPic").src = "data:image/png;base64,"
					+ blank_pro_image;
			}
			

			$("#curr_city").text(studentDetails.curr_city);
			$("#home_city").text(studentDetails.home_city);
			$("#skills").text(studentDetails.skills);
			$("#dob").text(studentDetails.d_o_b);
			$("#interest").text(studentDetails.interest);
			$("#hobbies").text(studentDetails.hobbies);
			$("#achievements").text(studentDetails.achievements);

			/* setting educational details */
			var edu = response.educationalDetails;
			education_table.rows().remove();
			for (var v = 0; v < edu.length; v++) {
				if (null == edu[v].department || edu[v].department == "")
					edu[v].department = "-";
				
				if (null == edu[v].end_date || edu[v].end_date == "")
					edu[v].end_date = "-";
				
				education_table.row.add([edu[v].category,edu[v].department,edu[v].organization,edu[v].board,edu[v].description,
					edu[v].end_date]).draw(false);
			}

			// setting profession details
			$("#projectFieldset").hide();
			$("#trainingFieldset").hide();
			$("#worksampleFieldset").hide();
			$("#internshipFieldset").hide();
			$("#jobFieldset").hide();
			project_table.rows().remove();
			training_table.rows().remove();
			worksample_table.rows().remove();
			internship_table.rows().remove();
			job_table.rows().remove();
			var studPastProfessions = response.studPastProfessions;
			for(i=0;i<studPastProfessions.length;i++){
				addStudentProfRow(studPastProfessions[i]);
			}
			$("#divLoading").hide();
		},

		error : function() {
			alert('Error occured');
		}
	});
}

function addStudentProfRow(studentPastProfession){
	if(studentPastProfession.category == 'P'){
		project_table.row.add([studentPastProfession.organization,studentPastProfession.profile,studentPastProfession.department,
		studentPastProfession.start_date,studentPastProfession.end_date,studentPastProfession.link,studentPastProfession.description]).draw(false);
		$("#projectFieldset").show();
	} else if(studentPastProfession.category == 'T'){
		training_table.row.add([studentPastProfession.organization,studentPastProfession.profile,
			studentPastProfession.department,studentPastProfession.location,
			studentPastProfession.start_date,studentPastProfession.end_date]).draw(false);
		$("#trainingFieldset").show();
	} else if(studentPastProfession.category == 'W'){
		worksample_table.row.add(["<a href='http://"+studentPastProfession.link+"' target='_blank'>"
			+studentPastProfession.link+"</a>"]).draw(false);
		$("#worksampleFieldset").show();
	} else if(studentPastProfession.category == 'I'){
		internship_table.row.add([studentPastProfession.organization,studentPastProfession.location,
			studentPastProfession.profile,studentPastProfession.department,
			studentPastProfession.start_date,studentPastProfession.end_date,
			studentPastProfession.link,studentPastProfession.description]).draw(false);
		$("#internshipFieldset").show();
	} else if(studentPastProfession.category == 'J'){
		job_table.row.add([studentPastProfession.organization,studentPastProfession.location,
			studentPastProfession.profile,studentPastProfession.department,
			studentPastProfession.start_date,studentPastProfession.end_date,
			studentPastProfession.description]).draw(false);
		$("#jobFieldset").show();
	}
}

function getCompanyDetails(elem){
	$.ajax({
		type : "GET",
		url : "getCompanyDetails?company_id=" + elem,
		success : function(response) {
			$("#det_title").text(response.company_name);
			$("#det_est").text(response.estd_date);
			$("#det_contact1").text(response.contact_1);
			$("#det_contact2").text(response.contact_2);
			$("#det_email").text(response.email_id);
			//$("#det_weburl").innerHTML = '<a href="'+response.web_url + '">' + response.web_url + '</a>';
			$("#det_weburl").text(response.web_url);
			document.getElementById('det_weburl_link').href='http://' + response.web_url;
			$("#det_about_us").text(response.about);
			$('#item_logo').attr('src', 'data:image/png;base64,'+response.logo);
			$("#details_modal").modal("show");
		},
		error : function() {
			alert('Error occured');
		}
	});
}

function getCollegeDetails(elem,show_dept){
		$.ajax({
		type : "GET",
		url : "getCollegeDetails?college_id=" + elem,
		success : function(response) {

			/*getting college details along with departments table data*/
			var collegeDetails = response.college;
			var deptDetails;
			if(show_dept){
				$("#deptDetailsBody").empty();
				if(response.department=="none")
				{
					$("#deptDetailsBody").append("This College hasn't registered any department yet.");
				}else{
					deptDetails=response.department;
					for(var i = 0 ; i < deptDetails.length; i++)
					{
						var tableRow = "<tr><td>" +deptDetails[i]+"</td></tr>";
						$("#deptDetailsBody").append(tableRow);
					}
					$("#deptDetailsBody").show();
				}
				$("#coll_details_dept").show();
				 $("#details_modal").modal();
			} else{
			$("#coll_details_dept").hide();
			$("#det_title").text(collegeDetails.college_name);
			$("#det_est").text(collegeDetails.estd_date);
			$("#det_contact1").text(collegeDetails.contact_1);
			$("#det_contact2").text(collegeDetails.contact_2);
			$("#det_email").text(collegeDetails.email_id);
			//$("#det_weburl").innerHTML='<a href="'+response.web_url+'">'+response.web_url+'</a>';
			$("#det_weburl").text(collegeDetails.web_url);
			document.getElementById('det_weburl_link').href='http://' + collegeDetails.web_url;
			$("#about_us_para").hide();
			$('#item_logo').attr('src', 'data:image/png;base64,'+collegeDetails.logo);
			$("#details_modal").modal("show");
			}
			
		},
		error : function() {
			alert('Error occured');
		}
	});
}


function closeModal() {
    // Find the modal element by its ID
    var modal = document.getElementById('studentDetailsModal');

    // Check if the modal element exists
    if (modal) {
        // Close the modal by removing the 'show' class
        modal.classList.remove('show');
        
        // Reset the scroll position to the top
        modal.scrollTop = 0;

        // Hide the modal backdrop
        var modalBackdrop = document.querySelector('.modal-backdrop');
        if (modalBackdrop) {
            modalBackdrop.style.display = 'none';
        }
    }
}
